This beautiful (and sad) adagio is a single release from Doc and Lena Selyanina's coming album Ground Zero. The theme of the album is the atomic bombing of Hiroshima on 6th of August in 1945.

The song is respectfully dedicated to the victims and to the survivors of the bomb.


Composition &amp; keyboards: Lena Selyanina
Arrangement: Doc &amp; Lena Selyanina
Mix &amp; production: Doc


